import axios from 'axios';
import React, { useEffect, useState } from 'react';

const PokemonList = ({pokemon}) => {

  const [pokeUrl, setPokeUrl] = useState()

  useEffect(() => {
    axios.get(
    ).then(res => {
      setPokeUrl(res.data.results.map(p => p.url))
    })
  }, [])

  return (
    <div>
      {pokeUrl}
    </div>
  );
};

export default PokemonList;
